package Repositories;import Models.Subscriber;import java.util.ArrayList;import java.util.List;public class SubscriberCrudOperations implements CrudOperations<Subscriber> {    private List<Subscriber> subscribers;    public SubscriberCrudOperations() {        this.subscribers = new ArrayList<>();    }        @Override        public List<Subscriber> findAll () {            return subscribers;        }        @Override        public List<Subscriber> saveAll (List < Subscriber > toSave) {            subscribers.addAll(toSave);            return toSave;        }            @Override            public Subscriber save (Subscriber toSave){                subscribers.add(toSave);                return toSave;            }            @Override            public Subscriber delete (Subscriber toDelete){                subscribers.remove(toDelete);                return toDelete;            }    }